import React from "react";

const ExpensesList = props => { 
    if (props.filteredYear.length === 0) {
        return <h2>No data found</h2>
    }
    
    filteredYear.map((item) => {
        return (
            <ExpenseItem
                key={ item.id}
                itemDate={item.date}
                itemName={item.title}
                itemPrice={item.amount}
            />
        );
    })
}

export default ExpensesList;
